def solve_sudoku(board):
    def find_next_empty():
        for row in range(9):
            for col in range(9):
                if board[row][col] == 0:
                    return (row, col)
        return None

    def possible_numbers(row, col):
        used = set()
        # Check row
        for num in board[row]:
            if num != 0 and num != '.':
                used.add(num)
        # Check column
        for i in range(9):
            num = board[i][col]
            if num != 0 and num != '.':
                used.add(num)
        # Check subgrid
        start_row = (row // 3) * 3
        start_col = (col // 3) * 3
        for i in range(3):
            for j in range(3):
                num = board[start_row + i][start_col + j]
                if num != 0 and num != '.':
                    used.add(num)
        # Generate possible numbers
        possible = []
        for num in range(1, 10):
            if num not in used:
                possible.append(num)
        return possible

    def solve():
        row, col = find_next_empty()
        if row is None:
            return True  # Solved
        possible = possible_numbers(row, col)
        for num in possible:
            board[row][col] = num
            if solve():
                return True
            board[row][col] = 0  # Backtrack
        return False

    solve()
    return board

